<p>Celebration! Model Kaia Gerber turned 19-years-old on Thursday and her doting parents, Cindy Crawford and Rande Gerber, each took to social media with sweet tributes to their 'not so little' girl</p>

<p>Cindy gushed in a sweet Instagram post: 'Happy birthday to my not so little princess! Wishing you health and happiness and the confidence to be the highest version of yourself.'</p>

<p>'So proud of the woman you are becoming,' she penned in the caption.</p>

<p>The affectionate post included two throwback photos of a young Kaia - already looking like a little model.</p>

<p>The first sees the the future catwalker all smiles at one of her birthday parties, dressed in a pink princess down and a gold crown, from when she looked to be around four or five years old.</p>

<p>Too cute! Cindy shared an adorable photo of Kaia dressed in a pink princess down and a gold crown from when she looked to be around four or five years old</p>

<p>In her Instagram Story, Cindy posted an even younger birthday photo of Kaia - possibly her first - wearing a fuzzy pink party hat.</p>

<p>Cindy, who looks like she's barely aged a bit, smiled sweetly next to her baby in the vintage party shot.</p>

<p>Rande, meanwhile, shared a snap of his only daughter from when she was 14. The photogenic beauty smiled brightly at the camera, makeup free, in a black bikini top.</p>

<p>'Happy Birthday my little angel. I thought I was in trouble when I took this 5 years ago but your beauty on the inside has proven to be even bigger than your smile. I love you forever,' he wrote in the caption. </p>

<p>'Happy Birthday my little angel. I thought I was in trouble when I took this 5 years ago but your beauty on the inside has proven to be even bigger than your smile. I love you forever,' dad Rande Gerber gushed in his post</p>

<p>Along with Kaia, Rande and Cindy are also parents to older son Presley, 21. </p>

<p>The top model may be entering into the final year of her teens with a new man on her slim arm.</p>

<p>She and Euphoria hunk Jacob Elordi were enjoyed a late dinner at the celeb-beloved Nobu Malibu on Tuesday. </p>

<p>After dinner, he, Kaia and her sweet little pooch hopped into his Range Rover and drove off. </p>

<p>Beautiful family: Along with Kaia, Rande and Cindy are also parents to older son Presley, 21 (The Gerbers in 2017)</p>

<p>While the pair definitely seemed close, there didn't appear to be anything romantic between the two but something may be on the horizon. </p>

<p>Jacob has kept quite quiet about his love life, but seems to meet his ladies on set.</p>

<p>He previously dated Kissing Booth co-star Joey King but had most recently been linked to his Euphoria co-star Zendaya, 24.</p>

<p>The Aussie actor and former Disney Channel star sparked romance rumors earlier this year after being spotted in NYC and Jacob's native Australia together, but have since been quarantining on separate continents. </p>

<p>New year, new man: The top model may be entering into the final year of her teens with a new man on her slim arm and was seen at dinner with Jacob Elordi this week amid rumors that the actor 'has interest in dating Kaia'</p>

